int prime[50000],num=-1;
int size=2;
int mod,md;

mat mul(mat a,mat b){
    mat tmp;
    int i,j,k;
    for(i=1;i<=size;i++){
        for(j=1;j<=size;j++){
            tmp.m[i][j]=0;
            for(k=1;k<=size;k++){
                tmp.m[i][j]=(tmp.m[i][j]+(a.m[i][k]*b.m[k][j])%mod)%mod;
            }
        }
    }
    return tmp;
}

long long qp(long long a,long long n){
    long long tmp=a,ans=1;
    while(n){
        if(n&1)ans=ans*tmp%md;
        tmp=tmp*tmp%md;
        n>>=1;
    }
    return ans;
}

mat QP(mat a,int n){
    mat ans,tmp;
    memcpy(tmp.m,a.m,sizeof(tmp.m));
    for(int i=1;i<=size;i++){
        ans.m[i][i]=1;
    }
    while(n){
        if(n&1)ans=mul(ans,tmp);
        n>>=1;
        tmp=mul(tmp,tmp);
    }
    return ans;
}

